import React, { Component } from 'react';

class Header extends Component {
    render() { 
        return ( 
            <div>
                <button className="btn btn-dark mt-3 ml-3">Battle</button>

                <div className="float-right mt-3">
                    <button className="btn btn-dark mr-3">Followers</button>
                    <button className="btn btn-dark mr-3">Repositories</button>

                    <button className="btn btn-dark mr-3">JavaScript</button>
                    <button className="btn btn-dark">Java</button>
                    <button className="btn btn-dark">Python</button>
                    <button className="btn btn-dark">PHP</button>
                </div>
            </div>
         );
    }
}

export default Header;
